import React, {Component} from 'react';
import classes from './NavigationItems.module.css';
import NavigationItem from '../NavigationItem/NavigationItem';
import {Navbar, Nav } from 'react-bootstrap';
import {NavLink} from 'react-router-dom';

class NavigationItems extends Component {

  render(){
    return(
    <Navbar collapseOnSelect className={classes.NavBarStyle} collapseOnSelect expand="lg" bg="#f3f3f3" variant="light">
      <Navbar.Brand href="/" className={classes.NavigationItems}>CASSANDRA</Navbar.Brand>
      <Navbar.Toggle className={classes.NavBarMobile} aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className={classes.NavLink + " ml-auto"}>
          <NavLink  eventKey="1" to="/home" className="nav-link">HOME</NavLink>
        <NavLink  eventKey="2" to="/instructional-design" className="nav-link">INSTRUCTIONAL DESIGN</NavLink>
          <NavLink to="/technical-writing" className="nav-link">TECHNICAL WRITING</NavLink>
          <NavLink to="/contact" className="nav-link">CONTACT</NavLink>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
    )
  }
}

export default NavigationItems;
